    <h1 {...{
      "id": "fraction"
    }}>{`Fraction`}</h1>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`constructor(numerator: BigintIsh, denominator: BigintIsh = ONE)
`}</code></pre>
    <p>{`The base class which all subsequent fraction classes extend. `}<strong parentName="p">{`Not meant to be used directly.`}</strong></p>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <h3 {...{
      "id": "numerator"
    }}>{`numerator`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`numerator: JSBI
`}</code></pre>
    <h3 {...{
      "id": "denominator"
    }}>{`denominator`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`denominator: JSBI
`}</code></pre>
    <h3 {...{
      "id": "quotient"
    }}>{`quotient`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`quotient: JSBI
`}</code></pre>
    <p>{`Performs floor division.`}</p>
    <h2 {...{
      "id": "methods"
    }}>{`Methods`}</h2>
    <h3 {...{
      "id": "invert"
    }}>{`invert`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`invert(): Fraction
`}</code></pre>
    <h3 {...{
      "id": "add"
    }}>{`add`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`add(other: Fraction | BigintIsh): Fraction
`}</code></pre>
    <h3 {...{
      "id": "subtract"
    }}>{`subtract`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`subtract(other: Fraction | BigintIsh): Fraction
`}</code></pre>
    <h3 {...{
      "id": "multiply"
    }}>{`multiply`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`multiply(other: Fraction | BigintIsh): Fraction
`}</code></pre>
    <h3 {...{
      "id": "divide"
    }}>{`divide`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`divide(other: Fraction | BigintIsh): Fraction
`}</code></pre>
    <h3 {...{
      "id": "tosignificant"
    }}>{`toSignificant`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`toSignificant(
  significantDigits: number,
  format: object = { groupSeparator: '' },
  rounding: Rounding = Rounding.ROUND_HALF_UP
): string
`}</code></pre>
    <p>{`Formats a fraction to the specified number of significant digits.`}</p>
    <ul>
      <li parentName="ul">{`For format options, see `}<a parentName="li" {...{
          "href": "https://github.com/MikeMcl/toFormat"
        }}>{`toFormat`}</a>{`.`}</li>
    </ul>
    <h3 {...{
      "id": "tofixed"
    }}>{`toFixed`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`toFixed(
  decimalPlaces: number,
  format: object = { groupSeparator: '' },
  rounding: Rounding = Rounding.ROUND_HALF_UP
): string
`}</code></pre>
    <p>{`Formats a fraction to the specified number of decimal places.`}</p>
    <ul>
      <li parentName="ul">{`For format options, see `}<a parentName="li" {...{
          "href": "https://github.com/MikeMcl/toFormat"
        }}>{`toFormat`}</a>{`.`}</li>
    </ul>
    <h1 {...{
      "id": "percent"
    }}>{`Percent`}</h1>
    <p>{`Responsible for formatting percentages (10% instead of 0.1).`}</p>
    <h2 {...{
      "id": "example"
    }}>{`Example`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`import { Percent } from '@uniswap/sdk'

const percent = new Percent('60', '100')
console.log(percent.toSignificant(2)) // 60
`}</code></pre>
    <h3 {...{
      "id": "tosignificant-1"
    }}>{`toSignificant`}</h3>
    <p>{`See `}<a parentName="p" {...{
        "href": "#tosignificant"
      }}>{`toSignificant`}</a>{`.`}</p>
    <h3 {...{
      "id": "tofixed-1"
    }}>{`toFixed`}</h3>
    <p>{`See `}<a parentName="p" {...{
        "href": "#tofixed"
      }}>{`toFixed`}</a>{`.`}</p>
    <h1 {...{
      "id": "tokenamount"
    }}>{`TokenAmount`}</h1>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`constructor(token: Token, amount: BigintIsh)
`}</code></pre>
    <p>{`Responsible for formatting token amounts with specific decimal places.`}</p>
    <h2 {...{
      "id": "example-1"
    }}>{`Example`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`import { Token, TokenAmount } from '@uniswap/sdk'

const FRIED = new Token(ChainId.MAINNET, '0xfa1aFe1000000000000000000000000000000000', 18, 'FRIED', 'Beans')

const tokenAmount = new TokenAmount(FRIED, '3000000000000000000')
console.log(tokenAmount.toExact()) // 3
`}</code></pre>
    <h2 {...{
      "id": "properties-1"
    }}>{`Properties`}</h2>
    <h3 {...{
      "id": "token"
    }}>{`token`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`token: Token
`}</code></pre>
    <h3 {...{
      "id": "raw"
    }}>{`raw`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`raw: JSBI
`}</code></pre>
    <p>{`Returns the full token amount, unadjusted for decimals.`}</p>
    <h2 {...{
      "id": "methods-1"
    }}>{`Methods`}</h2>
    <h3 {...{
      "id": "add-1"
    }}>{`add`}</h3>
