        "href": "#tosignificant"
      }}>{`toSignificant`}</a>{`.`}</p>
    <h3 {...{
      "id": "tofixed-2"
    }}>{`toFixed`}</h3>
    <p>{`See `}<a parentName="p" {...{
        "href": "#tofixed"
      }}>{`toFixed`}</a>{`.`}</p>
    <h3 {...{
      "id": "toexact"
    }}>{`toExact`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`toExact(format: object = { groupSeparator: '' }): string
`}</code></pre>
    <h1 {...{
      "id": "price"
    }}>{`Price`}</h1>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`constructor(baseToken: Token, quoteToken: Token, denominator: BigintIsh, numerator: BigintIsh)
`}</code></pre>
    <p>{`Responsible for denominating the relative price between two tokens. Denominator and numerator must be unadjusted for decimals.`}</p>
    <h2 {...{
      "id": "example-2"
    }}>{`Example`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`import { ChainId, WETH as WETHs, Token, Price } from '@uniswap/sdk'

const WETH = WETHs[ChainId.MAINNET]
const ABC = new Token(ChainId.MAINNET, '0xabc0000000000000000000000000000000000000', 18, 'ABC')

const price = new Price(WETH, ABC, '1000000000000000000', '123000000000000000000')
console.log(price.toSignificant(3)) // 123
`}</code></pre>
    <p>{`This example shows the ETH/XYZ price, where ETH is the base token, and XYZ is the quote token. The price is constructed from an amount of XYZ (the numerator) / an amount of WETH (the denominator).`}</p>
    <h2 {...{
      "id": "static-methods"
    }}>{`Static Methods`}</h2>
    <h3 {...{
      "id": "fromroute"
    }}>{`fromRoute`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`fromRoute(route: Route): Price
`}</code></pre>
    <h2 {...{
      "id": "properties-2"
    }}>{`Properties`}</h2>
    <h3 {...{
      "id": "basetoken"
    }}>{`baseToken`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`baseToken: Token
`}</code></pre>
    <h3 {...{
      "id": "quotetoken"
    }}>{`quoteToken`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`quoteToken: Token
`}</code></pre>
    <h3 {...{
      "id": "scalar"
    }}>{`scalar`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`scalar: Fraction
`}</code></pre>
    <p>{`Used to adjust the price for the decimals of the base and quote tokens.`}</p>
    <h3 {...{
      "id": "raw-1"
    }}>{`raw`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`raw: Fraction
`}</code></pre>
    <p>{`Returns the raw price, unadjusted for decimals.`}</p>
    <h3 {...{
      "id": "adjusted"
    }}>{`adjusted`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`adjusted: Fraction
`}</code></pre>
    <p>{`Returns the price, adjusted for decimals.`}</p>
    <h2 {...{
      "id": "methods-2"
    }}>{`Methods`}</h2>
    <h3 {...{
      "id": "invert-1"
    }}>{`invert`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`invert(): Price
`}</code></pre>
    <h3 {...{
      "id": "multiply-1"
    }}>{`multiply`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`multiply(other: Price): Price
`}</code></pre>
    <h3 {...{
      "id": "quote"
    }}>{`quote`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`quote(tokenAmount: TokenAmount): TokenAmount
`}</code></pre>
    <p>{`Given an asset amount, returns an equivalent value of the other asset, according to the current price.`}</p>
    <h3 {...{
      "id": "tosignificant-3"
    }}>{`toSignificant`}</h3>
    <p>{`See `}<a parentName="p" {...{
        "href": "#tosignificant"
      }}>{`toSignificant`}</a>{`.`}</p>
    <h3 {...{
      "id": "tofixed-3"
    }}>{`toFixed`}</h3>
    <p>{`See `}<a parentName="p" {...{
        "href": "#tofixed"
      }}>{`toFixed`}</a>{`.`}</p>
    </MDXLayout>;
}

